// ============================================
// FUNCIÓN PRINCIPAL
// ============================================

async function importProducts() {
    console.log('🚀 Iniciando importación de productos...\n');

    try {
        // 1. Obtener categorías y marcas
        console.log('📦 Obteniendo categorías y marcas...');
        const { data: categories } = await supabase.from('categories').select('*');
        const { data: brands } = await supabase.from('brands').select('*');

        if (!categories || !brands) {
            throw new Error('No se pudieron obtener categorías o marcas');
        }

        console.log(`✅ ${categories.length} categorías encontradas`);
        console.log(`✅ ${brands.length} marcas encontradas\n`);

        // 2. Crear mapas para búsqueda rápida
        const categoryMap = new Map(categories.map(c => [c.slug, c.id]));
        const brandMap = new Map(brands.map(b => [b.name.toUpperCase(), b.id]));

        // 3. Procesar productos
        let imported = 0;
        let skipped = 0;
        let errors = 0;

        for (const product of products) {
            try {
                // Buscar IDs
                const categoryId = categoryMap.get(product.cat);
                const brandId = brandMap.get(product.brand.toUpperCase());

                if (!categoryId) {
                    console.warn(`⚠️  Categoría no encontrada: ${product.cat} (${product.name})`);
                    skipped++;
                    continue;
                }

                // Preparar datos
                const productData = {
                    code: product.codigo,
                    name: product.name,
                    slug: product.name.toLowerCase().replace(/\s+/g, '-').replace(/[^\w-]/g, ''),
                    description: product.desc || null,
                    capacity: product.cap || null,
                    material: product.mat || null,
                    category_id: categoryId,
                    brand_id: brandId || null,
                    status: product.status || 'available',
                    is_new: product.isNovedad || false,
                    is_featured: false
                };

                // Insertar
                const { error } = await supabase
                    .from('products')
                    .insert([productData]);

                if (error) {
                    // Si ya existe, intentar actualizar
                    if (error.code === '23505') { // Duplicate key
                        const { error: updateError } = await supabase
                            .from('products')
                            .update(productData)
                            .eq('code', product.codigo);

                        if (updateError) {
                            console.error(`❌ Error actualizando ${product.codigo}:`, updateError.message);
                            errors++;
                        } else {
                            console.log(`🔄 Actualizado: ${product.name}`);
                            imported++;
                        }
                    } else {
                        console.error(`❌ Error insertando ${product.codigo}:`, error.message);
                        errors++;
                    }
                } else {
                    console.log(`✅ Importado: ${product.name}`);
                    imported++;
                }

            } catch (err: any) {
                console.error(`❌ Error procesando ${product.codigo}:`, err.message);
                errors++;
            }
        }

        // 4. Resumen
        console.log('\n' + '='.repeat(50));
        console.log('📊 RESUMEN DE IMPORTACIÓN');
        console.log('='.repeat(50));
        console.log(`✅ Importados/Actualizados: ${imported}`);
        console.log(`⚠️  Omitidos: ${skipped}`);
        console.log(`❌ Errores: ${errors}`);
        console.log(`📦 Total procesados: ${products.length}`);
        console.log('='.repeat(50));

    } catch (error: any) {
        console.error('❌ Error general:', error.message);
        process.exit(1);
    }
}

// ============================================
// EJECUTAR
// ============================================

importProducts()
    .then(() => {
        console.log('\n✅ Importación completada!');
        process.exit(0);
    })
    .catch((error) => {
        console.error('\n❌ Error fatal:', error);
        process.exit(1);
    });

// ============================================
// INSTRUCCIONES DE USO:
// ============================================

/*
1. Guardar este archivo como: backend/scripts/import-products.ts

2. Asegurarse de que el .env tenga:
   SUPABASE_SERVICE_KEY=tu_service_key

3. Ejecutar:
   cd backend
   npx tsx scripts/import-products.ts

4. Para importar TODOS los 723 productos:
   - Copiar el array completo de productos desde tu HTML
   - Reemplazar el array "products" en este archivo
   - Ejecutar el script

NOTA: El script es inteligente:
- Si el producto ya existe (mismo código), lo actualiza
- Si falta la categoría, lo omite y muestra warning
- Si falta la marca, la deja en NULL
- Muestra progreso en tiempo real
*/
